package Revised;

public class PrintedTable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int i=1;i<=20;i++) {
			int tableOf =i;
			for(int j=1;j<=10;j++) {
				System.out.println(+tableOf*j+" \n"+j+" \n"+i+" \n"  );
			}
			//System.out.println();
		}
		

	}

}
